import React, { useState, useEffect } from 'react'
import ListGroup from 'react-bootstrap/ListGroup';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Api from '../resources/apis';

const Requests: React.FC = () => {
  const [requests, setRequests] = useState<any>([])

  const getRequests = () => {

    new Api().getRequests().then(response=>{
        console.log("Getting data")
        console.log(response)
        console.log(response.status)

        if(response.status == 200){
          //  console.log("Successfully added request")
           setRequests(response.data);
           console.log("2 divided by 1 is ")
           console.log(7%2)
        }

    }).catch(error => {
        console.log("Error returned is ... ")
        console.log(error)
    })
}

useEffect(()=>{
  getRequests()
},[])

    return <Container fluid>
    <ListGroup>
      {
        requests.map((req: any,i: any)=>{
         return <ListGroup.Item key={i} action style={{backgroundColor: '#edf5f6'}}>
        <Container fluid>
          <Row>
            <Col xs={6}>
              <Row>
                <Col xs={12} md={12}><b>{ req.name }</b></Col>
              </Row>
              <Row>
                <Col xs={12} md={12}>{ req.number }</Col>
              </Row>
              <Row>
                <Col xs={12} md={12}><small><b>{ req.email }</b></small></Col>
              </Row>
            </Col>
            <Col xs={6}>
              <b>{ req.place_of_interest }</b>
            </Col>
          </Row>
        </Container>
      </ListGroup.Item>
        })
      }
    </ListGroup>
    </Container>
}

export default Requests
